import {
	BrowserRouter,
	Route,
	Routes,
} from '../node_modules/react-router-dom/index';
import data from './data';
import HomeScreen from './screens/HomeScreen';

function App() {
	return (
		<BrowserRouter>
			<div>
				<header>
					<a href="/">amazona</a>
				</header>
				<main>
					<Routes>
						<Route path="/" element={<HomeScreen />}></Route>
						<h1>Featured Products</h1>
					</Routes>
				</main>
			</div>
		</BrowserRouter>
	);
}

export default App;
